// frontend/src/pages/Landing.tsx
import React from 'react';
import { motion } from 'framer-motion';
import { 
  Code2, 
  Map, 
  Share2, 
  Book, 
  Users, 
  LineChart 
} from 'lucide-react';
import Navbar from '../components/common/Navbar';
import { Link } from 'react-router-dom';

const HeroSection = () => (
  <div className="relative min-h-[600px] bg-gradient-to-r from-blue-900 to-indigo-900">
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 pt-32 pb-16">
      <div className="text-center">
        <motion.h1 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          className="text-4xl sm:text-5xl md:text-6xl font-bold text-white mb-6"
        >
          OpenSLAM Platform
        </motion.h1>
        <motion.p 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.2 }}
          className="text-xl text-blue-100 mb-8"
        >
          Democratizing Simultaneous Localization and Mapping Research
        </motion.p>
        <motion.div 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.4 }}
          className="flex flex-col sm:flex-row justify-center gap-4"
        >
          <Link 
            to="/get-started" 
            className="px-8 py-3 bg-blue-500 hover:bg-blue-600 text-white rounded-lg font-semibold transition-all"
          >
            Get Started
          </Link>
          <Link 
            to="/documentation" 
            className="px-8 py-3 bg-transparent border-2 border-white text-white hover:bg-white hover:text-blue-900 rounded-lg font-semibold transition-all"
          >
            Documentation
          </Link>
        </motion.div>
      </div>
    </div>
    <div className="absolute inset-0 overflow-hidden pointer-events-none">
      <div className="absolute w-96 h-96 bg-blue-500 rounded-full opacity-10 blur-3xl -top-20 -left-20" />
      <div className="absolute w-96 h-96 bg-indigo-500 rounded-full opacity-10 blur-3xl -bottom-20 -right-20" />
    </div>
  </div>
);

const features = [
  {
    icon: Code2,
    title: "Algorithm Development",
    description: "Develop and test SLAM algorithms with our comprehensive toolkit and APIs"
  },
  {
    icon: Map,
    title: "Real-time Visualization",
    description: "Interactive 3D visualization of trajectories and point clouds"
  },
  {
    icon: Share2,
    title: "Easy Integration",
    description: "Simple integration with popular datasets and existing SLAM systems"
  },
  {
    icon: Book,
    title: "Educational Resources",
    description: "Learn SLAM concepts with interactive tutorials and documentation"
  },
  {
    icon: Users,
    title: "Community Driven",
    description: "Join a growing community of SLAM researchers and developers"
  },
  {
    icon: LineChart,
    title: "Performance Analysis",
    description: "Comprehensive tools for analyzing and comparing SLAM results"
  }
];

const FeatureCard = ({ icon: Icon, title, description }) => (
  <motion.div 
    whileHover={{ y: -5 }}
    className="bg-white p-6 rounded-xl shadow-lg"
  >
    <div className="w-12 h-12 bg-blue-100 rounded-lg flex items-center justify-center mb-4">
      <Icon className="w-6 h-6 text-blue-600" />
    </div>
    <h3 className="text-xl font-semibold mb-2">{title}</h3>
    <p className="text-gray-600">{description}</p>
  </motion.div>
);

const FeaturesSection = () => (
  <div className="py-20 bg-gray-50">
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
      <div className="text-center mb-16">
        <h2 className="text-3xl font-bold text-gray-900 mb-4">
          Platform Features
        </h2>
        <p className="text-xl text-gray-600">
          Everything you need to research, develop, and analyze SLAM algorithms
        </p>
      </div>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        {features.map((feature, index) => (
          <FeatureCard key={index} {...feature} />
        ))}
      </div>
    </div>
  </div>
);

const LandingPage = () => {
  return (
    <div className="min-h-screen">
      <Navbar />
      <HeroSection />
      <FeaturesSection />
    </div>
  );
};

export default LandingPage;
